import React, { Component } from 'react';
import './App.css';
import Button from '@material-ui/core/Button';

class App extends Component {

    render() {
      return (
        <header class="bg-black-90 fixed w-100 ph3 pv3 pv4-ns ph4-m ph5-l mt0">
          <nav class="f6 fw6 ttu tracked flex .items-center">
            <Button class="dim white dib mr3" href="#" title="Home">Home</Button>
            <Button class="dim white dib mr5" href="#" title="About">About</Button>
            <h1 class="dim white dib mr5 mt0" href="#" title="Name">Katie Macaulay</h1>
            <Button class="dim white dib mr3" href="#" title="Work">Work</Button>
            <Button class="dim white dib" href="#" title="Contact">Contact</Button>
          </nav>
        </header>
      );
    }
  }

  export default App;
